  const civInput = document.getElementById('civilId');
  const searchBtn = document.getElementById('searchBtn');
  const clearBtn = document.getElementById('clearBtn');
  const resultDiv = document.getElementById('result');

  function renderRecord(rec) {
    let html = '<table>';
    html += '<thead><tr><th>الحقل</th><th>القيمة</th></tr></thead><tbody>';
    for (const k of Object.keys(rec)) {
      const safeK = escapeHtml(k);
      const safeV = escapeHtml(rec[k]);
      html += `<tr><td>${safeK}</td><td>${safeV}</td></tr>`;
    }
    html += '</tbody></table>';
    return html;
  }

  function escapeHtml(str) {
    if (str === null || str === undefined) return '';
    return String(str)
      .replace(/&/g, "&amp;")
      .replace(/</g, "&lt;")
      .replace(/>/g, "&gt;")
      .replace(/"/g, "&quot;")
      .replace(/'/g, "&#039;");
  }

  function doSearch() {
    const q = civInput.value.trim();
    if (!q) {
      resultDiv.style.display = 'block';
      resultDiv.innerHTML = '<div class="notfound">الرجاء إدخال الرقم المدني.</div>';
      return;
    }
    const rec = STUDENT_DATA[q] || null;
    if (!rec) {
      const alt = q.replace(/^0+/, '');
      const recAlt = STUDENT_DATA[alt] || null;
      if (recAlt) {
        resultDiv.style.display = 'block';
        resultDiv.innerHTML = '<div><strong>نتيجة (بعد تعديل الرقم):</strong></div>' + renderRecord(recAlt);
        return;
      }
      resultDiv.style.display = 'block';
      resultDiv.innerHTML = `<div class="notfound">لم أجد بيانات لهذا الرقم: <strong>${escapeHtml(q)}</strong></div>`;
      return;
    }
    resultDiv.style.display = 'block';
    resultDiv.innerHTML = renderRecord(rec);
  }

  searchBtn.addEventListener('click', doSearch);
  civInput.addEventListener('keydown', function(e){ if (e.key === 'Enter') doSearch(); });
  clearBtn.addEventListener('click', function(){ civInput.value=''; resultDiv.style.display='none'; });
</script>
